import React from "react";

class App extends React.Component {
    render() {
        return (
            <div>
                <h1> Test </h1>
            </div>
        );
    }
}

export class Test extends React.Component {
    render() {
        return (
            <div className="Test">
                <p> This is another test </p>
            </div>
        );
    }
}

export default App;
